My build.ts if that makes sense:
```
import { OptionalDepsPlugin } from 'bun-plugin-optional-deps';
import { join } from 'path';

const tsFilesGlob = new Bun.Glob('*.ts');
const tsFiles = [...tsFilesGlob.scanSync('./prisma')].map((file) =>
  join('./prisma', file),
);

const out = await Bun.build({
  entrypoints: ['./src/main.ts', ...tsFiles],
  format: 'esm',
  minify: {
    identifiers: false,
    syntax: true,
    whitespace: true,
  },
  outdir: './dist',
  packages: 'bundle',
  plugins: [OptionalDepsPlugin],
  sourcemap: 'linked',
  target: 'node',
  external: ['jsdom'],
});

console.log('Build completed', out.success ? 'successfully' : out);
```

